  \"2013-03-19T00:27:46.197100\",\n\t\"name\": \"bedrock-geologic-map-of-the-eagle-a-2-quadrangle-fortymile-mining-district-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Alaska Division of Geological & Geophysical
  Surveys (DGGS) has conducted 1:63,360-scale geologic mapping of the Eagle A-2 Quadrangle
  (270 square miles; equivalent to four 7.5-minute quadrangles). The area is part
  of the 100-year old Fortymile mining district and is located in eastern Alaska near
  the Alaska-Yukon border. This geologic map was produced by merging a bedrock geologic
  map and a surficial geologic map of the Eagle A-2 Quadrangle and based upon results
  from field investigations by DGGS in 1999 and 2000, which were part of a three-year
  mapping program to provide geologic ground truth for airborne geophysical surveys
  flown by DGGS in the Fortymile mining district during 1998.\",\n\t\"license_title\":
